			shellPath = /bin/sh;
			shellScript = "# This script takes the build product and creates an AU and VST version, \n# then installs them for testing. \n\noriginal=$CONFIGURATION_BUILD_DIR/$FULL_PRODUCT_NAME\n\necho \"protoplug [$CONFIGURATION] starting postbuild in $original\"\nsed -i \"\" -e 's/TDMwPTul/BNDLPTul/g' \"$original/Contents/PkgInfo\"\nsed -i \"\" -e 's/TDMw/BNDL/g' \"$original/Contents/$INFOPLIST_FILE\"\n\necho \"Creating VST version...\"\nVST1=$CONFIGURATION_BUILD_DIR/$PRODUCT_NAME.vst\nif [ -d \"$VST1\" ]; then \n  rm -r \"$VST1\"\nfi\ncp -r \"$original\" \"$VST1\"\n\necho \"Installing VST...\"\nVST2=~/Library/Audio/Plug-Ins/VST/$PRODUCT_NAME.vst\nif [ -d \"$VST2\" ]; then \n  rm -r \"$VST2\"\nfi\ncp -r \"$VST1\" \"$VST2\"\n\n\n# Fix info.plist for AUs built with Xcode 3\nif [ -f \"$DEVELOPER_DIR/Library/Developer/CoreAudio/AudioUnits/AUPublic/AUBase/AUPlugInDispatch.cpp\" ]; then\n  echo\nelse\n  echo \"Removing AudioComponents entry from Info.plist because this is not a new-format AU\"\n  /usr/libexec/PlistBuddy -c \"Delete AudioComponents\" \"$original/Contents/Info.plist\"\nfi\n\necho \"Installing AU...\"\nAU=~/Library/Audio/Plug-Ins/Components/$PRODUCT_NAME.component\nif [ -d \"$AU\" ]; then \n  rm -r \"$AU\"\nfi\ncp -r \"$original\" \"$AU\"\n";
		};
